Response:  The number of people who have been to Phuket is given as 180 million. We are asked how many times these people have visited Phuket in total. To find this out, we need to divide the number of people who have been to Phuket by the number of visits per person. So, if each person has visited Phuket 2 times on average, then the total number of visits to Phuket is:

180 million / 2 = 90 million visits
Therefore, the answer is 90 million visits.;;

